import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';

function MyBlog()
{
      let str = "aaaaaaaaaaas dddddddd fffffffffffff ssssssssss ffffffffffffffffff     rrrrrrrrrrrrrrrrrrrrrrrr rrrrrrrrrrrrrrrrrrrrrrrr rrrrrrrrrrrrrrrrr"
      return (
         <>

        <div class="Blog">
        <div class ="TopNavigation d-flex flex-row">
            <a href = "/abc">Back To Home</a>
             <div style ={{marginLeft: '330px'}}>
            <Link to = '/AddNewBlog'>
             <button type="button" class="btn btn-success Button" style = {{borderRadius:'30px'}}>Add New Post</button>
             </Link>
                 <button type="button" class="btn btn-warning Button" style = {{borderRadius:'30px'}}>Edit</button>
                 <button type="button" class="btn btn-danger Button" style = {{borderRadius:'30px'}}>DeLETE</button>
            </div>
       </div>
        <div class = 'd-flex flex-column'>
         <div class='Text'>
            <span class = "TextVal">{"Title "}</span> {str}
         </div>

         <div class='Text'>
         <span class = "TextVal">{"Title "}</span> {str}
         </div>

         <div class='Text'>
         <span class = "TextVal">{"Title "}</span> {str}
         </div>
         </div>

         <div class="d-flex mt-3 ml-5">
                 {/* <li><a href="#">Page 1</a></li>
                 <li><a href="#">Page 2</a></li>
                 <li><a href="#">Page 3</a></li> */}
                   <button type="button" class="btn btn-warning">Next</button>
                   <button type="button" class="btn btn-dark ml-3">Previous</button>
         </div>
          
      </div>
      </>
      )
}

export default MyBlog;
